import React from 'react';
import { BrowserRouter as Router,Switch,Route,Link } from "react-router-dom";
import './App.css';
import HomePage from './HomePage';

function App() {
  return (
    <div className="app">
      <HomePage />
      <Router>
        <Switch>
          <Route path="/">
            <HomePage />
          </Route>
        </Switch>
    </Router>
    </div>
  );
}

export default App;
